window.bookSummaryJSON = "<p>\"Becoming a Dodge Tank was just the beginning.\"</p> <p>The world boss is defeated, but Ryanâ€™s troubles are far from over.</p> <p>Transported to a new world, Ryan and his friends must figure out how to save their home city of Citadel while learning to survive in a game world where death is now all too real.</p> <p>But first, Ryan must keep his promise to Val Helena, and he sets out on a dangerous quest to the Vale of Sorrows to defeat the Shadow King. With an enemy 10 times stronger than a world boss, Ryan will have to do some serious leveling up as a Dodge Tank to be fit for task.</p> <p>But when he encounters a fellow gamer with an agenda of his own, Ryan finds his plans not only derailed, but his very life threatened by an enemy of his own making!</p> <p>Ryan will have to grow in both level and maturity to face the difficult struggles ahead. But the game has more secrets to reveal, and the enemy lying just below the surface may be more terrifying than anything he could have imagined.</p>"; 
